import React from 'react';
import css from './Faq.module.css';

const Importans = ({ important, index, toggleImportans }) => {
  return (
    <>
      <div className={css.importantContent}>
        <div className={css.importantTitle}>Lorem</div>
        <div className={css.importantText}>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Harum iure
          veritatis autem minima nesciunt fugiat blanditiis omnis, cumque
          praesentium molestiae nemo consectetur ut dolorem laudantium pariatur
          sit, voluptas asperiores eius!
        </div>

        <button
          className={`${css.important} ${important.open ? css.open : ''}`}
          key={index}
          onClick={() => toggleImportans(index)}
        >
          Read All
        </button>
      </div>
      <div className={css.importantImage}></div>
    </>
  );
};

export default Importans;
